import React, { useState } from 'react';
import Kebab from '../images/kebab.svg'
function Header(){
  const [ display, setDisplay ]= useState(false);
  return(<div className="header" onClick={()=>{setDisplay(false); alert(display)}}>
  <h2>ChatApp</h2>
  <img src={Kebab} onClick={()=>{setDisplay(true); alert(display)}}/>
  </div>);
}
export default Header;
